import {
  Container,
  Header,
  Content,
  Input,
  Item,
  Button,
  StyleProvider,
} from "native-base";
// import { AntDesign } from "@expo/vector-icons";

export default function Login() {
  return (
    <Container>
      <View style={styles.titlecontainer}>
        <Text>간단한 설문을 통해 맞춤 식물을 추천해 드립니다.</Text>
      </View>
      <View style={styles.contentcontainer}>
        <Text>hi</Text>
      </View>
      <View style={styles.buttoncontainer}>
        <Text>hi</Text>
      </View>
    </Container>
  );
}

const styles = StyleSheet.create({
  titlecontainer: {
    flex: 2,
    justifyContent: "flex-end",
    alignItems: "center",
  },
  contentcontainer: {
    flex: 5,
    justifyContent: "center",
    alignItems: "center",
  },
  buttoncontainer: {
    flex: 2,
    justifyContent: "center",
    alignItems: "center",
  },
});
